import React from "react";
import styled from "styled-components";

const Box = (props) => {
  return <Block>{props.children}</Block>;
};

export default Box;

const Block = styled.div`
  font-family: "Roboto", sans-serif;
  display: flex;
  flex-direction: column;
  align-items: center;
  height: 100vh;
  overflow: hidden;
  margin: 0;
`;
